import React from "react";
import { Row, Col } from "react-flexbox-grid";
import "./about.scss";
// Components
import TeamBox from './teamBox';
import TeamInfo from "./teamInfo";
import Title from "../ui-components/title/title";
// Assets
import Person01 from "../../assets/about/person01.png";
import Person02 from "../../assets/about/person02.png";

const about = () => (
  <div id="about">
    <div className="wrapper">
      <Title title="SOBRE NOSOTROS." />
      <p className="font12">
      Nuestro equipo conformado por Carlos Alvarado, barista especializado en italia, ganador de varios concursos. 
      Complementando con el Ingeniero Agrónomo Herbert Juarez, especializado en el cultivo y producción de café 100% orgánico.
      </p>
      <Row>
        <Col md={12} lg={4}>
          <TeamBox avatar={Person01} name="Carlos Alvarado" job="Barista" />
        </Col>
        <Col md={12} lg={4}>
          <TeamBox avatar={Person02} name="Herbert Juerez" job="CEO - Barista" />
        </Col>
        <Col md={12} lg={4}>
          <TeamInfo />
        </Col>
      </Row>
    </div>
  </div>
);

export default about;
